import React from "react";
import Carousel from "./partial/carousel";

import carousel1 from '../img/carousel/c01.jpg';
import carousel2 from '../img/carousel/c02.jpg';
import carousel3 from '../img/carousel/c03.jpg';
import carousel4 from '../img/carousel/c04.jpg';
import carousel5 from '../img/carousel/c05.jpg';

function Home(){
    return (
        <div>

            <Carousel 
                img1={carousel2}
                img2={carousel2}
                img3={carousel3}
                img4={carousel4}
                img5={carousel1}
            />
        </div>
    )
}

export default Home;
